INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("青空の下で謁見", 2, 1, 10118, 91002, "ペコリーヌとの出会い", 8, "フリーマーケット会場", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 20063115, 40, 5118061, 2834, 7);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("未来の騎空団\nマスコット？", 2, 1, 10118, 91002, "マホとの出会い", 8, "フリーマーケット会場", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 20063115, 40, 5118062, 2835, 7);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("お嬢さまからの\n緊急依頼", 2, 1, 10118, 91002, "アキノとの出会い", 8, "ランドソル市街地", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 20063115, 40, 5118063, 2837, 7);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("黄金色の悩みごと", 2, 1, 10118, 91002, "ジュンとの出会い", 8, "フリーマーケット会場", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 20063115, 40, 5118064, 4108402, 18);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("白熱！　格闘大会！", 2, 1, 10118, 91002, "カオリとの出会い", 8, "フリーマーケット会場", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 20063115, 40, 5118065, 4107402, 18);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("祭り太鼓はオーエドの華", 2, 1, 10118, 91002, "ニノンとの出会い", 8, "オーエド町", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 20063115, 40, 5118066, 9000227, 16);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("人気者は遅れて\nやってくる", 3, 1, 10118, 91002, "スズナとの出会い", 8, "フリーマーケット会場", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 20063115, 40, 5118067, 2101181, 19);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("巫女・ミーツ・魔法少女", 3, 1, 10118, 91002, "ナナカとの出会い", 8, "ランドソル市街地", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 20063115, 40, 5118068, 4109402, 18);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ネズ耳は二度なくなる", 3, 1, 10118, 91002, "キャル＆コッコロとの出会い", 8, "フリーマーケット会場", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 20063115, 40, 5118069, 4305402, 18);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("この出会いにカンパイ！", 3, 1, 10118, 91002, "ユカリとの出会い", 8, "ランドソル市街地", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 20063115, 40, 5118070, 4101402, 18);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("陰陽アンサンブル", 3, 1, 10118, 91002, "アオイとの出会い", 8, "ランドソル市街地", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 20063115, 40, 5118071, 4106402, 18);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("運試し十番勝負！", 3, 1, 10118, 91002, "シノブとの出会い", 8, "フリーマーケット会場", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 20063115, 40, 5118072, 2836, 7);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("彼女たちの新たな日常", 1, 0, 10118, 0, "オープニング", 0, 0, 0, 0, 20063115, 0, 5118600, 0, 0);
